36\" [:div nil [:div [:p/markdown \"## Interactive input and reactive notes\\n\\nComing soon.\"]]], \"166\" [:div [:p/code {:code \"^k/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"121\" [:div nil [:div [:big [:big 3]]]], \"218\" [:div nil [:div [:p/markdown \"All other notes witn no explicit metadata are assigned the kind `:naive` automatically.\"]]], \"62\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"75\" [:div nil [:div [:p/markdown \"## Basic workflow\\n\\nTypically, you may like to edit one or more namespaces, that may be about function definitions, tests, data exploration, etc., and have Notespace update its notebook view while these namespaces evolve. At some point, you may like to render the view as a standalone html file for documentation.\\n\\nSee [this screencast](https://www.youtube.com/watch?v=_GcTnkhn9g0) for a recorded session. Note, however, that the note kinds defined in the screencast are a bit different from those of the current version.\\n### The main API functions\\n\\nLet us see how to get along with notespaces using the Notespace API.\\n#### init\\n\\nUse `notespace.api/init` to initialize the Notespace system's state.\\n\\nIn the beginning of your work, you need to use it.\\n\\nYou can also use it afterwards. That is useful if you run into an unstable state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### init-with-browser\\n\\nUse `notespace.api/init-with-browser` to initialize the Notespace system's state and open a browser tab with a notebook view of the last namespace touched.\\n\\nIn the beginning of your work, you can use it instead of `init`.\\n\\nYou can always refersh the browser tab. That is useful if it runs out of sync with the system's state (yes, this may happen sometimes -- there may be some concurrency bugs).\\n#### eval-this-notespace\\n\\nUse `notespace.api/eval-this-notespace` to evaluate the current namespace, one note after another, and inform Notespace about the evaluation results, one after another.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n#### eval-note-at-line\\n\\nUse `notespace.api/eval-note-at-line` to evaluate the note at a certain line and inform Noteapace about the evaluation result.\\n\\nFor example, `(notespace.api/eval-note-at-line 14)` applies that to the note at line 14.\\n\\nIf you have a browser view open, it should show the updated rendering of the state of the notespace last touched.\\n\\nThis is useful for re-evaluating parts of the notebook, whose evaluation result may have changed for some reason.\\n#### render-static-html\\n\\nUse `notespace.api/render-static-html` to render the Notespace state of the notespace last touched as a standalone html file. This html should look exactly as the dynamic browser view at the moment of rendering.\"]]], \"194\" [:div [:p/code {:code \"(D (+ 1 2))\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"168\" [:div [:p/code {:code \"p1\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"24\" [:div [:p/code {:code \"(require '[notespace.api :refer [D]])\", :bg-class \"bg-light\"}] [:div [:div [:big [:big \"...\"]]]]], \"76\" [:div nil [:div [:p/markdown \"### Editor integration\\n\\nFor a convenient interactive experience, it is ecommended to bind the Notespace API functions to functions of your editor.\\n\\nYou can see how to do this in Emacs in [this Elisp code](https://github.com/scicloj/notespace/blob/v3/emacs-config.el). In the future, we will probably provide similar solutions for other editors too.\"]]], \"35\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"154\" [:div [:p/code {:code \"(deliver p2 14)\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"14\\n\"}]]], \"209\" [:div nil [:div [:p/markdown \"## Unit tests\\n\\nComing soon.\"]]], \"6\" [:div nil [:div s which are sequential forms beginning with a string (e.g., `[\\\"Hello!\\\" \\\"How are you?\\\"]`) are assigned the default kind `:md-nocode`  automatically.\\nThis very text you are reading is an example of a note of that kind.\"]]], \"63\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"84\" [:div nil [:div [:p/markdown \"#### eval-and-realize-note-at-line\\n\\nUse `notespace.api/eval-and-realize-note-at-line` to evaluate the note at a certain line, realize the value if it is an unrealized derefable value, and inform Noteapace about the result.\\n\\nFor example, `(notespace.api/eval-and-realize-note-at-line 14)` applies that to the note at line 14.\"]]], \"177\" [:div [:p/code {:code \"^k/dataset-grid\\n{:x (range 9)\\n :y (repeatedly 9 rand)\\n :z (take 9 (cycle \\\"abc\\\"))}\", :bg-class \"bg-light\"}] [:div [:div {:class \"ag-theme-balham\", :style {:height \"150px\"}} [:p \"(showing first 100 rows)\"] [:p/dataset {:columnDefs [{:headerName \"x\", :field \"x\"} {:headerName \"y\", :field \"y\"} {:headerName \"z\", :field \"z\"}], :rowData ({\"x\" 0, \"y\" 0.4501284235566245, \"z\" \\a} {\"x\" 1, \"y\" 0.5060808821775997, \"z\" \\b} {\"x\" 2, \"y\" 0.31927818703754274, \"z\" \\c} {\"x\" 3, \"y\" 0.271195871952453, \"z\" \\a} {\"x\" 4, \"y\" 0.7820887658119148, \"z\" \\b} {\"x\" 5, \"y\" 0.4268846138675194, \"z\" \\c} {\"x\" 6, \"y\" 0.3206647429940739, \"z\" \\a} {\"x\" 7, \"y\" 0.5366807977824332, \"z\" \\b} {\"x\" 8, \"y\" 0.25053752550216457, \"z\" \\c})}]]]], \"43\" [:div nil [:div [:div [:big [:big \"...\"]]]]], \"125\" [:div [:p/code {:code \"^k/hiccup\\n[:p/player\\n {:width  \\\"100%\\\"\\n  :height \\\"100%\\\"\\n  :url    \\\"https://www.youtube.com/watch?v=G512fvK9KXA\\\"}]\", :bg-class \"bg-light\"}] [:div [:p/player {:width \"100%\", :height \"100%\", :url \"https://www.youtube.com/watch?v=G512fvK9KXA\"}]]], \"104\" [:div [:p/code {:code \"(require '[notespace.kinds :as k])\", :bg-class \"bg-light\"}] [:div [:p/code {:code \"nil\\n\"}]]], \"95\
